"""**6. Plausibilidad y rangos (10 min)**

Construye results/reportes/range_check.csv con columnas: feature, unidad, tipo, rango_esperado, %missing, obs_min, obs_max, flag.

Pistas:


*   Usá DataFrame.select_dtypes para identificar columnas numéricas.
*   df[col].agg(['min','max']) y df[col].isna().mean() ayudan a llenar la tabla.
*   Para flag, compará contra tu rango esperado con Series.between o Series.

5.1) Missingness (5 min) -

Exportá results/perfiles/missing.csv con df.isna().sum().sort_values() y results/perfiles/missing_pct.csv con proporciones. - Grafica un barplot de missing por columna en results/visualizaciones/missing.png.

Pistas:
*   df.isna().sum() y división por len(df) para porcentajes; usa Series.sort_values.
*   Para el gráfico, usá seaborn.barplot sobre el índice y valores del Series.

"""

supuestos_rangos = {
    'sepal_length': (4.0, 8.0),
    'sepal_width': (2.0, 4.5),
    'petal_length': (1.0, 7.0),
    'petal_width': (0.1, 2.5)
}
numeric_cols = df.select_dtypes(include='number').columns

rows = []
for col in numeric_cols:
    rango = supuestos_rangos.get(col, (None, None))
    obs_min = df[col].min()
    obs_max = df[col].max()
    pct_missing = df[col].isna().mean() * 100
    flag = df[col].between(rango[0], rango[1]).all()

    rows.append({
        'feature': col,
        'unidad': 'cm',
        'tipo': 'numérico',
        'rango_esperado': f'{rango[0]} - {rango[1]}',
        '%missing': round(pct_missing, 2),
        'obs_min': obs_min,
        'obs_max': obs_max,
        'flag': flag
    })

range_check_df = pd.DataFrame(rows)
os.makedirs('results/reportes', exist_ok=True)

REPORTES_DIR = Path("results/reportes")
REPORTES_DIR.mkdir(parents=True, exist_ok=True)
range_check_path = REPORTES_DIR / "range_check.csv"
range_check_df.to_csv(range_check_path, index=False)

