import seaborn as sns
import matplotlib.pyplot as plt

plt.style.use('seaborn-v0_8')
os.makedirs(PLOTS_DIR, exist_ok=True)

# 1. Matriz de correlaciones
corr = df.select_dtypes('number').corr()
plt.figure(figsize=(8, 6))
sns.heatmap(corr, annot=True, cmap='Blues')
plt.title("Matriz de correlaciones")
plt.tight_layout()
plt.savefig(PLOTS_DIR / 'corr.png', dpi=200, bbox_inches='tight')
plt.close()

# 2. Pairplot por especie
pair = sns.pairplot(df, hue='species', diag_kind='kde')
pair.fig.suptitle("Pairplot por especie", y=1.02)
pair.savefig(PLOTS_DIR / 'pairplot.png', dpi=200, bbox_inches='tight')
plt.close()

# 3. Boxplots por variable y especie
for col in df.select_dtypes('number').columns:
    plt.figure(figsize=(6, 4))
    sns.boxplot(data=df, x='species', y=col)
    plt.title(f'Boxplot de {col} por especie')
    plt.tight_layout()
    plt.savefig(PLOTS_DIR / f'boxplot_{col}.png', dpi=200, bbox_inches='tight')
    plt.close()

# 4. Histogramas con KDE por especie
for col in df.select_dtypes('number').columns:
    plt.figure(figsize=(6, 4))
    sns.histplot(data=df, x=col, hue='species', kde=True, element='step', stat='density', common_norm=False)
    plt.title(f'Histograma de {col} con KDE por especie')
    plt.tight_layout()
    plt.savefig(PLOTS_DIR / f'hist_{col}.png', dpi=200, bbox_inches='tight')
    plt.close()

